interface NewMovieInt{
    id: number | undefined;
    name: string;
    image: string;
    actors: string;
    genre: string;
    duration: number;
    description: string;
}

interface NewTvShowInt extends NewMovieInt{
    season: string;
    episodes: number;
}

interface WachedInt{
    id: number | undefined;
    watchId: number;
    rating: string;
    thoughts: string;
    isMovie: boolean;
}


export class Movie implements NewMovieInt{
    constructor(
    public id: number | undefined,
    public name: string,
    public image: string,
    public actors: string,
    public genre: string,
    public duration: number,
    public description: string,
    ){}
}
export class TvShow implements NewTvShowInt{
    constructor(
        public id: number | undefined,
        public name: string,
        public image: string,
        public actors: string,
        public genre: string,
        public duration: number,
        public season: string,
        public episodes: number,
        public description: string,
        ){}
}

export class Watched implements WachedInt{
    constructor(
    public id: number | undefined,
    public watchId: number,
    public rating: string,
    public thoughts: string,
    public isMovie: boolean,
    ){}

}

export function isTvShow(watch: Movie | TvShow): watch is TvShow{
    return (watch as TvShow).season !== undefined;
}
